/*-----------------------------------------------------------------------------------------------------
  Получение приращения нормированного угла на каждом такте ШИМ заданной частоты для синусоиды заданной частоты

  Принимаем отображение угла (фазы) синусоиды из диапазона 0...360 градусов в диапазон
  целочисленного значения 0...0x100000000 т.е. в диапазон типа int32_t

  За один период сигнала проходит N = pwm_freq/sig_freq тактов частоты PWM.
  Делим значение величины 0x100000000 на N чтобы получить приращение на каждом такте ШИМ - дельту.

  \param sig_freq  - частота сигнала
  \param pwm_freq  - частота модуляции

  \return unsigned int - результат
-----------------------------------------------------------------------------------------------------*/
uint32_t SinGen_get_delta(float sig_freq, float pwm_freq)
{
  uint64_t   v;
  int32_t    delta;

  v = (uint64_t)sig_freq;
  v = v << 32;
  delta = (int32_t)((float)v/pwm_freq);

  return delta;
}

/*-----------------------------------------------------------------------------------------------------
  Получение значений 3-фазного синуса в формате Signed Fixed-point, WordLength:32, FractionLength:31

  \param norm_angle  - Нормированный к диапазону 0...0xFFFFFFFF угол (фаза) синусоиды
  \param delta       - Приращение нормированного угла на каждом такте ШИМ для заданной частоты синусоиды
  \param psin        - Структура с возвращаемыми значениями для 3 значений синуса сдвинутых на 120 град друг относительно друга

  \return uint32_t
-----------------------------------------------------------------------------------------------------*/
uint32_t  SinGen_get_3ph_sin(uint32_t norm_angle, uint32_t delta, T_int32_3ph *psin)
{
  uint32_t   indx;

  // Превращаем нормированный угол в индекс таблицы, размер которой равен 2^SMPLS_INDX_BITS
  indx = norm_angle >> (32 - SMPLS_INDX_BITS);
  psin->a = SIN_TBL[indx];

  // К нормированному углу добавляем значение соответствующее 120 градусам и получаем индекс в таблице
  indx = (norm_angle + 0x55555555ul) >> (32 - SMPLS_INDX_BITS);
  psin->b = SIN_TBL[indx];

  // К нормированному углу добавляем значение соответствующее 240 градусам и получаем индекс в таблице
  indx = (norm_angle + 0xAAAAAAAAul) >> (32 - SMPLS_INDX_BITS);
  psin->c = SIN_TBL[indx];

  return norm_angle + delta;
}

